pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./Auction.sol";

contract NftExample is ERC721URIStorage, lol_auction{
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;
    uint256 _tokenCounter;

    address payable putbid;
    address payable Auction_creator;

    mapping(uint256 => User_Nft) map_Usern_Nft;
    
    mapping(uint => uint) internal tokenTokenIndexes;
    
     event all_nfts(string []); 
    
    
     struct User_Nft{
        uint _id;
        mapping(uint256 => uint256) map_bid;
        mapping(uint256 => string) map_username;
        mapping(address => string[]) ownerTokenURI;
        

        mapping(address => uint256) balances;
        
        mapping(uint256 => Test) map_token_list;
        
        mapping(uint256 => address) map_token_owner;
        mapping(uint256 => string) map_token_URI;
     }

     struct Test{
         uint id;
         address address_;
         string token_uri;
         string user;
     }

    User_Nft new_nft;


    constructor() ERC721("Robel", "RBT") {}

    function mintNft(address receiver, string memory tokenURI, string memory _username) public returns (uint256) {
        
        _mint(receiver, _tokenCounter);
        _setTokenURI(_tokenCounter, tokenURI);
        
        new_nft.balances[receiver] = balanceOf(receiver);
        new_nft.ownerTokenURI[receiver].push(tokenURI);

        new_nft.map_token_list[_tokenCounter] = Test(_tokenCounter, receiver, tokenURI, _username);
        
        new_nft._id = _tokenCounter;
        new_nft.map_username[_tokenCounter] = _username;
        new_nft.map_token_owner[_tokenCounter] = receiver;
        new_nft.map_token_URI[_tokenCounter] = tokenURI;
        _tokenCounter = _tokenCounter + 1;
        return _tokenCounter;
    }
    
     function getBid() public view returns (Test[] memory){
      Test[] memory allTest = new Test[](_tokenCounter);
      for (uint i = 0; i < _tokenCounter; i++) {
          Test storage allTests = new_nft.map_token_list[i];
          allTest[i] = allTests; 
      }
      return allTest;
  }
  

    
     function get_token_uri(uint _id) public view returns(address, string memory, string memory){
         string memory curr_name = new_nft.map_username[_id];
         address curr_address = new_nft.map_token_owner[_id];
         string memory curr_TokenURI = new_nft.map_token_URI[_id];
         return (curr_address, curr_TokenURI, curr_name);
    }
    
    function get_token_counter() public view returns(uint){
        return _tokenCounter;
    }

     function get_user_tokenURI(address input) public view returns(string memory){
            string memory get_tokenURI;
            for(uint i; i < _tokenCounter; i++){
                
                if(input == new_nft.map_token_owner[i]){
                    get_tokenURI = new_nft.map_token_URI[i];
                    get_tokenURI = new_nft.map_token_URI[i];
                    get_tokenURI = new_nft.map_token_URI[i];
                }
            }
            return (get_tokenURI);
        }
    

        function get_user_name(address input) public view returns(string memory){
            string memory get_user;
            for(uint i; i < _tokenCounter; i++){
                
                if(input == new_nft.map_token_owner[i]){
                    get_user = new_nft.map_username[i];
                }
            }
            return (get_user);
        }

        function get_user_tokenID(string memory _input) public view returns(uint){
            uint get_ID;
            for(uint i; i < _tokenCounter; i++){
                
                if(keccak256(abi.encodePacked((_input))) == keccak256(abi.encodePacked((new_nft.map_token_list[i].token_uri)))){
                    get_ID = new_nft.map_token_list[i].id;
                }
            }
            return (get_ID);
        }

    
        
        function get_owners_tokenURI(address _owner) external returns (string  [] memory){
                    emit all_nfts(new_nft.ownerTokenURI[_owner]);
                    return (new_nft.ownerTokenURI[_owner]);
                } 
        
        

        function get_id_uri(string memory _name, uint bid) public view returns (uint){
              uint _id;
              for(uint i; i < _tokenCounter; i++){
                if(keccak256(bytes(_name))  == keccak256(bytes(new_nft.map_username[i])) ){
                    _id = new_nft.map_bid[i];
                    
                }
            }

            return _id;
        }

    function get_all_nft() public view returns(string memory, address){
        string memory get_token;
        string memory get_username;
        address get_owner;

        for(uint i; i < _tokenCounter; i++){  
                get_username = new_nft.map_username[i];   
                get_token = new_nft.map_token_URI[i];
                get_owner = new_nft.map_token_owner[i];
        }   
        return (get_token, get_owner);
    }
 
        function transfer_auction_nft(address _from, uint256 _tokenId) public {
                address _to = super.get_bider_(_tokenId);
                emit Transfer(_from, _to, _tokenId);
               
                
                string memory curr_user = get_user_name(_to);
                
                string memory curr_token_URI = tokenURI(_tokenId);
                _to = super.get_bider_(_tokenId);
                
                new_nft.map_token_list[_tokenId] = Test(_tokenId, _to, curr_user, curr_token_URI);
                
                new_nft.map_username[_tokenId] = curr_user;
                new_nft.map_token_owner[_tokenId] = _to;
                new_nft.balances[_from]--;
                new_nft.balances[_to]++;
        }

        function get_id_uri(address _from) public view returns (Test [] memory){
              
              Test[] memory allTest = new Test[](_tokenCounter);
              for(uint i; i < _tokenCounter; i++){
                if(_from == new_nft.map_token_list[i].address_){
                    Test storage allTests = new_nft.map_token_list[i];
                    allTest[i] = allTests; 
                }
            }
            return allTest;
        }
 
        function transfer_nft(address _from, address _to, uint256 _tokenId) public {
    
                emit Transfer(_from, _to, _tokenId);
                
                string memory curr_user = get_user_name(_to);
                
                string memory curr_token_URI = tokenURI(_tokenId);
                

                new_nft.map_token_list[_tokenId] = Test(_tokenId, _to, curr_token_URI, curr_user);
                new_nft.map_username[_tokenId] = curr_user;
                new_nft.map_token_owner[_tokenId] = _to;

                new_nft.balances[_from]--;
                new_nft.balances[_to]++;
        }
        
}
